import React, { useState } from 'react';

const FilterSidebar = () => {
  const [price, setPrice] = useState([50, 200]);
  const [isCategoryOpen, setIsCategoryOpen] = useState(true);

  const handlePriceChange = (event) => {
    const value = event.target.value.split(',').map(Number);
    setPrice(value);
  };

  const toggleCategory = () => {
    setIsCategoryOpen(!isCategoryOpen);
  };

  return (
    <div style={styles.sidebar}>
      <div style={styles.header}>
        <h3 style={styles.title}>Filters</h3>
        <button style={styles.filterIcon}>⚙️</button>
      </div>

      <div style={styles.section}>
        <div onClick={toggleCategory} style={styles.categoryTitle}>
          <span>Máy ảnh & Máy quay</span>
          <span>{isCategoryOpen ? '▲' : '▼'}</span>
        </div>
        {isCategoryOpen && (
          <ul style={styles.categoryList}>
            <li style={styles.categoryItem}>
              <span>Ống kính</span>
              <span style={styles.badge}>16</span>
            </li>
            <li style={styles.categoryItem}>Chân máy</li>
            <li style={styles.categoryItem}>Flycam</li>
            <li style={styles.categoryItem}>Smart phone</li>
          </ul>
        )}
      </div>

      <div style={styles.section}>
        <h4 style={styles.priceTitle}>Price</h4>
        <div style={styles.sliderContainer}>
          <input
            type="range"
            min="0"
            max="300"
            value={price[0]}
            onChange={(e) => setPrice([Number(e.target.value), price[1]])}
            style={styles.slider}
          />
          <input
            type="range"
            min="0"
            max="300"
            value={price[1]}
            onChange={(e) => setPrice([price[0], Number(e.target.value)])}
            style={styles.slider}
          />
        </div>
        <div style={styles.priceRange}>
          <span>${price[0]}</span>
          <span>${price[1]}</span>
        </div>
      </div>

      <button style={styles.applyButton}>Apply Filter</button>
    </div>
  );
};

const styles = {
  sidebar: {
    width: '250px',
    padding: '16px',
    border: '1px solid #ddd',
    borderRadius: '8px',
    fontFamily: 'Arial, sans-serif',
  },
  header: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginBottom: '16px',
  },
  title: {
    fontSize: '18px',
    fontWeight: 'bold',
    margin: 0,
  },
  filterIcon: {
    background: 'none',
    border: 'none',
    fontSize: '18px',
    cursor: 'pointer',
  },
  section: {
    marginBottom: '16px',
  },
  categoryTitle: {
    fontSize: '16px',
    fontWeight: 'bold',
    display: 'flex',
    justifyContent: 'space-between',
    cursor: 'pointer',
    marginBottom: '8px',
  },
  categoryList: {
    listStyleType: 'none',
    padding: 0,
    margin: 0,
  },
  categoryItem: {
    display: 'flex',
    justifyContent: 'space-between',
    padding: '8px 0',
    fontSize: '14px',
    cursor: 'pointer',
  },
  badge: {
    backgroundColor: '#FF5722',
    color: '#fff',
    borderRadius: '12px',
    padding: '2px 6px',
  },
  priceTitle: {
    fontSize: '16px',
    fontWeight: 'bold',
    marginBottom: '8px',
  },
  sliderContainer: {
    display: 'flex',
    alignItems: 'center',
    gap: '8px',
    marginBottom: '8px',
  },
  slider: {
    flex: 1,
    cursor: 'pointer',
    appearance: 'none',
    width: '100%',
    height: '5px',
    background: '#ddd',
    outline: 'none',
    opacity: '0.7',
    transition: 'opacity .15s ease-in-out',
  },
  priceRange: {
    display: 'flex',
    justifyContent: 'space-between',
    fontSize: '14px',
  },
  applyButton: {
    width: '100%',
    padding: '10px 0',
    backgroundColor: 'black',
    color: 'white',
    border: 'none',
    borderRadius: '5px',
    fontSize: '16px',
    cursor: 'pointer',
  },
};

export default FilterSidebar;
